import { useForm } from "react-hook-form";




const FormRegisterAdress: React.FC = () => {
        
        const { register, handleSubmit, formState: { errors } } = useForm();

        const submitForm = (data: any) => {
          
          window.location.href = '/RegisterAdress';
      
        };
      
      
        return (
      
          <>
      
            <FormModel onSubmit={handleSubmit(submitForm)} buttonText={buttonText}>
      
              {fields.map((field, index) => (
                <InputModel
                  key={index}
                  register={register}
                  type={field.type}
                  placeholder={field.placeholder}
                  error={errors[field.name] && field.error}
                />
      
              ))}
      
              <div className="flex flex-wrap gap-2 items-center my-3">
                <input
                  style={{ width: '1.5em', height: '1.5em' }}
                  className="checkbox: h-3/4"
                  type="checkbox"
                  {...register("agree", { required: true })}
                />
                <label className="flex items-center flex-wrap text-gray-400 text-2xl">
                  I agree with
                  <a href="#" className="flex flex-wrap items-center mx-2 text-gray-800 hover:underline">
                    terms of service & privacy
                    <img className="w-7" src="/external-link.svg" alt="Image of a link ancor" />
                  </a>
                </label>
              </div>
      
            </FormModel>
      
            <div className="my-3">
              <p className="text-gray-400 text-2xl">
                Already have an account? <Link className="text-gray-800 hover:underline" to={'/'}>Login here</Link>
              </p>
            </div>
      
          </>
      
        );
}

export default FormRegisterAdress;
